import configConstants from '@config/constants'

const {
  API: { baseURL, timeout }
} = configConstants

const fff = { name: 'Divine', age: '29', occupation: 'Software Engineer' }
const vvv = Object.entries(fff)

const hhh = vvv.map((arr, index) => arr[index])

const buuks = 'hello'

console.log('buuks', vvv)

export default buuks
